import React from 'react'
import './index.css'
import Logo from './chucknorris_logo_coloured_small@2x.svg'

const index = () => {
    return (
        <div className="header">
            <div className="backImg">
            <div className="logoCircle"><img className="logo" src={Logo}/></div>   
            </div>

        </div>
    )
}


export default index;
